export default [
    {
        id: 1,
        name: "earth",
        styles: {
            width: '30px',
             height: '30px',
             borderRadius: '50%',
             backgroundColor: 'rgb(0, 81, 255)',
             position: 'relative',
             animation: 'earth-orbit 15s linear infinite',
        }
    },{
        id: 2,
        name: "venus",
    },{
        id: 3,
        name: "mercury",
    }

]
